----CREACION USUARIO
CREATE USER examen IDENTIFIED BY prueba
DEFAULT TABLESPACE "USERS"
TEMPORARY TABLESPACE "TEMP";
grant connect, resource, create view, create materialized view to examen;




--------------tablas


CREATE TABLE BITACORA_CONTACTO
  (
    id_bitacora     INTEGER NOT NULL ,
    bit_fecha       DATE NOT NULL ,
    bit_descripcion VARCHAR2 (1000) NOT NULL ,
    bit_vigencia    CHAR (1) ,
    id_medio        INTEGER NOT NULL ,
    id_motivo       INTEGER NOT NULL ,
    cli_rut         INTEGER NOT NULL
  ) ;
ALTER TABLE BITACORA_CONTACTO ADD CONSTRAINT BITACORA_CONTACTO_PK PRIMARY KEY ( id_bitacora ) ;


CREATE TABLE CLIENTES
  (
    cli_rut              INTEGER NOT NULL ,
    cli_dv               CHAR (1) NOT NULL ,
    cli_nombre           VARCHAR2 (50) NOT NULL ,
    cli_apellido_paterno VARCHAR2 (50) NOT NULL ,
    cli_apellido_materno VARCHAR2 (50) ,
    cli_vigencia         CHAR (1) ,
    eje_rut              INTEGER NOT NULL
  ) ;
ALTER TABLE CLIENTES ADD CONSTRAINT CLIENTES_PK PRIMARY KEY ( cli_rut ) ;


CREATE TABLE EJECUTIVOS
  (
    eje_rut              INTEGER NOT NULL ,
    eje_dv               CHAR (1) NOT NULL ,
    eje_nombre           VARCHAR2 (50) NOT NULL ,
    eje_apellido_paterno VARCHAR2 (50) NOT NULL ,
    eje_apellido_materno VARCHAR2 (50) ,
    eje_vigencia         CHAR (1) ,
    jef_rut              INTEGER NOT NULL
  ) ;
ALTER TABLE EJECUTIVOS ADD CONSTRAINT EJECUTIVOS_PK PRIMARY KEY ( eje_rut ) ;


CREATE TABLE JEFES
  (
    jef_rut              INTEGER NOT NULL ,
    jef_dv               CHAR (1) NOT NULL ,
    jef_nombre           VARCHAR2 (50) NOT NULL ,
    jef_apellido_paterno VARCHAR2 (50) NOT NULL ,
    jef_apellido_materno VARCHAR2 (50) ,
    jef_vigencia         CHAR (1)
  ) ;
ALTER TABLE JEFES ADD CONSTRAINT JEFES_PK PRIMARY KEY ( jef_rut ) ;


CREATE TABLE MEDIO_CONTACTO
  (
    id_medio        INTEGER NOT NULL ,
    med_descripcion VARCHAR2 (50) NOT NULL ,
    med_vigencia    CHAR (1)
  ) ;
ALTER TABLE MEDIO_CONTACTO ADD CONSTRAINT MEDIO_CONTACTO_PK PRIMARY KEY ( id_medio ) ;


CREATE TABLE MOTIVOS
  (
    id_motivo       INTEGER NOT NULL ,
    mot_descripcion VARCHAR2 (50) NOT NULL ,
    mot_vigencia    CHAR (1)
  ) ;
ALTER TABLE MOTIVOS ADD CONSTRAINT MOTIVOS_PK PRIMARY KEY ( id_motivo ) ;


CREATE TABLE REGISTRO_LOG
  (
    id_log          INTEGER NOT NULL ,
    log_fecha       DATE ,
    log_descripcion VARCHAR2 (50) NOT NULL ,
    log_vigencia    CHAR (1) NOT NULL
  ) ;
ALTER TABLE REGISTRO_LOG ADD CONSTRAINT REGISTRO_LOG_PK PRIMARY KEY ( id_log ) ;


CREATE TABLE SUELDOS
  (
    id_sueldo      INTEGER NOT NULL ,
    sue_periodo    DATE NOT NULL ,
    sue_monto_base NUMBER (10,1) NOT NULL ,
    sue_comision   NUMBER (10,1) ,
    sue_vigencia   CHAR (1) ,
    eje_rut        INTEGER NOT NULL,
    sue_bono       NUMBER(10,1)
  ) ;
ALTER TABLE SUELDOS ADD CONSTRAINT SUELDOS_PK PRIMARY KEY ( id_sueldo ) ;

CREATE TABLE PAGO_EJECUTIVOS
  (
    pag_periodo             DATE NOT NULL ,
    pag_rut_ejecutivo       INTEGER NOT NULL,
    pag_sue_base            NUMBER(10,1) NOT NULL,
    pag_sue_comision        NUMBER (10,1) NOT NULL,
    pag_sue_bono            NUMBER (10,1) NOT NULL,
    pag_afp                 NUMBER (10,1) NOT NULL,
    pag_isapre              NUMBER (10,1) NOT NULL,
    pag_sue_total           NUMBER (10,1) NOT NULL
  ) ;
ALTER TABLE PAGO_EJECUTIVOS ADD CONSTRAINT PAGO_EJECUTIVOS_PK PRIMARY KEY (pag_periodo, pag_rut_ejecutivo ) ;

ALTER TABLE BITACORA_CONTACTO ADD CONSTRAINT BITCONTACTO_CLIENTES_FK FOREIGN KEY ( cli_rut ) REFERENCES CLIENTES ( cli_rut ) ;

ALTER TABLE BITACORA_CONTACTO ADD CONSTRAINT BITCONTACTO_MEDIO_CONTACTO_FK FOREIGN KEY ( id_medio ) REFERENCES MEDIO_CONTACTO ( id_medio ) ;

ALTER TABLE BITACORA_CONTACTO ADD CONSTRAINT BITCONTACTO_MOTIVOS_FK FOREIGN KEY ( id_motivo ) REFERENCES MOTIVOS ( id_motivo ) ;

ALTER TABLE CLIENTES ADD CONSTRAINT CLIENTES_EJECUTIVOS_FK FOREIGN KEY ( eje_rut ) REFERENCES EJECUTIVOS ( eje_rut ) ;

ALTER TABLE EJECUTIVOS ADD CONSTRAINT EJECUTIVOS_JEFES_FK FOREIGN KEY ( jef_rut ) REFERENCES JEFES ( jef_rut ) ;

ALTER TABLE SUELDOS ADD CONSTRAINT SUELDOS_EJECUTIVOS_FK FOREIGN KEY ( eje_rut ) REFERENCES EJECUTIVOS ( eje_rut ) ;








COMMIT;





